(1, , , , , 30, '#01979c', 'Palacio Municipal de Zumpango', 1, '2024-02-26', 'Los cementerios pronto volverán a llenarse de visitas para poner flores a los difuntos, limpiar sus tumbas o, simplemente, recordarlos de manera especial. Lejos de estos momentos de recogimiento, es importante entender que las cuestiones legales que rodean asuntos como inhumaciones, exhumaciones, traslado de cadáveres, compra de un espacio para ser enterrado, destrozos en cementerios, responsabilidades, costes del entierro o pago de tasas.\n\nFrente al hecho de que el descanso eterno está regido por una serie de normas que todo el mundo debe cumplir, Legálitas ha decidido repasar algunos de los aspectos más importantes de este sector.', '2023-08-01', NULL);
